import { NavigationProvider } from './NavigationContext'; // Import NavigationProvider

function App() {
  // Your state and other logic here

  return (
    <NavigationProvider> {/* Wrap the entire application with NavigationProvider */}
      <div>
        <Header />
        <div className="container">
          <h1></h1>
